export default function DevicesIDReducer(state = [], action) {
  switch (action.type) {
    case "FETCH_DEVICES_ID":
      console.log(action.payload.devicesID)
      return {
        ...state,
        devicesID: action.payload.devicesID,
      };
    default:
      return state;
  }
}
